  1.0: Plankton imagery data collected from F.G. Walton Smith in Straits of Florida
  from 2014-06-03 to 2014-06-06 and used in the 2015 National Data Science Bowl (NCEI
  Accession 0127422)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 15,\n\t\t\"recent\":
